import twitter from "./twitter.svg";

export const Footer = (props) => {
  return (
    <footer className="App-footer">
      <div className="footer-container">
        <div className="footer-logos-container">
          <img className="footer-logos-img" src={fb} alt="fb" />
          <img className="footer-logos-img" src={insta} alt="insta" />
          <img className="footer-logos-img" src={twitter} alt="twitter" />
